import styled from 'styled-components';
import {
    Container,
    Grid,
    Paper,
    Card,
    CardActionArea,
    CardActions,
    CardContent,
    CardMedia,
    Button,
    Typography,
} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    root: {
        maxWidth: 345,
    },
    media: {
        height: 140,
    },
});

const Coding = () => {
    const classes = useStyles();

    return (
        <Container fixed>
            <Grid container>
                <Grid item xs={12} fullWidth>
                    <Title>Coding expirience</Title>
                </Grid>
                <Grid item xs={4} fullWidth>
                    <Card className={classes.root}>
                        <CardActionArea>
                            <CardMedia
                                className={classes.media}
                                image='/public/teknikfokus.jpg'
                                title='Contemplative Reptile'
                            />
                            <CardContent>
                                <Typography
                                    gutterBottom
                                    variant='h5'
                                    component='h2'
                                >
                                    Lizard
                                </Typography>
                                <Typography
                                    variant='body2'
                                    color='textSecondary'
                                    component='p'
                                >
                                    Lizards are a widespread group of squamate
                                    reptiles, with over 6,000 species, ranging
                                    across all continents except Antarctica
                                </Typography>
                            </CardContent>
                        </CardActionArea>
                        <CardActions>
                            <Button size='small' color='primary'>
                                Share
                            </Button>
                            <Button size='small' color='primary'>
                                Learn More
                            </Button>
                        </CardActions>
                    </Card>
                </Grid>
                <Grid item xs={4} fullWidth>
                    <Paper>2</Paper>
                </Grid>
                <Grid item xs={4} fullWidth>
                    <Paper>3</Paper>
                </Grid>
            </Grid>
        </Container>
    );
};

export default Coding;

const Title = styled.p`
    margin-top: 0rem;
    color: white;
    font-size: 4rem;
`;
